import React from "react";
import Typewriter from "typewriter-effect";

function home() {
  return (
    <div>
      <h2>Hello Everyone I am Anish Kumar Singh</h2>
      <Typewriter
        onInit={(typewriter) => {
          typewriter
            .typeString("I am Anish Kumar Singh")
            .pauseFor(2500)
            .deleteAll()
            .typeString("Programmer")
            .pauseFor(2500)
            .deleteAll()
            .typeString("Developer")
            .pauseFor(2500)
            .deleteAll()
            .start();
        }}
      />
    </div>
  );
}

export default home;
